import React from 'react';
import ReactDOM from 'react-dom/client'; // Usamos 'react-dom/client' para React 18+
import { BrowserRouter as Router } from 'react-router-dom'; // Importa Router
import { MsalProvider } from '@azure/msal-react';  // Importar MsalProvider
import { msalInstance } from './msalConfig';  // Importar la configuración de MSAL
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <MsalProvider instance={msalInstance}>  {/* Envolvemos App con MsalProvider */}
    <Router>
      <App />  {/* Asegúrate de que la aplicación esté dentro de Router */}
    </Router>
  </MsalProvider>
);
